import React from 'react';
import { Box, ChakraProvider, extendTheme, Flex } from '@chakra-ui/react';
import { PiSealFill } from 'react-icons/pi';
import { MdEmail } from 'react-icons/md';
import { IoPersonAddOutline } from 'react-icons/io5';
import { BsQuestionLg } from 'react-icons/bs';

const theme = extendTheme({
  fonts: {
    body: '"Karla Variable", sans-serif',
  },
});

const IconSeal = ({ icon: Icon, bgColor = '#00bfff', size = '48px', ...props }) => {
  return (
    <Box position="relative" width={size} height={size} {...props}>
      <PiSealFill size={size} color="black" />
      <Flex
        position="absolute"
        top="0"
        left="0"
        right="0"
        bottom="0"
        alignItems="center"
        justifyContent="center"
        bg={bgColor}
        borderRadius="8px"
        margin="3px"
      >
        {Icon ? (
          <Icon size={`${parseInt(size) * 0.5}px`} color="black" />
        ) : (
          <BsQuestionLg size={`${parseInt(size) * 0.5}px`} color="black" />
        )}
      </Flex>
    </Box>
  );
};

const IconSealExamples = () => {
  return (
    <ChakraProvider theme={theme}>
      <Flex gap={4} p={4} bg="gray.100" justifyContent="center" alignItems="center" minHeight="100vh">
        <IconSeal icon={MdEmail} bgColor="#00bfff" size="48px" />
        <IconSeal icon={IoPersonAddOutline} bgColor="#b3ebf2" size="48px" />
        <IconSeal bgColor="#00bfff" size="48px" />
      </Flex>
    </ChakraProvider>
  );
};

export { IconSeal, IconSealExamples };
export default IconSealExamples;
